import React from 'react'
import {NavLink} from 'react-router-dom'
import './navbar.css'

const Navbar = () => {
  return (
    <div><ul>
    <li><NavLink to='/' className="active" >Home</NavLink></li>
    <li></li>
  </ul></div>
  )
}

export default Navbar
